import React, { useState } from "react";
import TodoItem from "./TodoItem";

const TodoList = ({ todos }) => {
  return (
    <ol>
      {todos.entries().map((todo) => (
        <TodoItem
          key={todo.key}
          text={todo.value.text}
          isCompleted={todo.isCompleted}
        />
      ))}
    </ol>
  );
};

export default TodoList;
